def relu(x):
    return [max(0.0, val) for val in x]

def tanh(x):
    return [math.tanh(val) for val in x]

def sigmoid(x):
    return [1.0 / (1.0 + math.exp(-val)) for val in x]

def get_observations(pod_data, opponent_data, checkpoints, boost_used, pod_id):
    # Constants for normalization
    WIDTH = 16000.0
    HEIGHT = 9000.0
    MAX_SPEED = 800.0
    CHECKPOINT_RADIUS = 600.0

    # Extract pod data
    x, y, vx, vy, angle, next_checkpoint_id = pod_data
    next_checkpoint_x, next_checkpoint_y = checkpoints[next_checkpoint_id]
    next_next_id = (next_checkpoint_id + 1) % len(checkpoints)
    next_next_checkpoint_x, next_next_checkpoint_y = checkpoints[next_next_id]

    # Start building observation vector
    obs = []

    # 1-2: Normalized position
    norm_x = (x * 2.0 / WIDTH) - 1.0
    norm_y = (y * 2.0 / HEIGHT) - 1.0
    obs.extend([norm_x, norm_y])

    # 3-4: Normalized velocity
    norm_vx = vx / 1000.0
    norm_vy = vy / 1000.0
    obs.extend([norm_vx, norm_vy])

    # 5-6: Relative position to next checkpoint (normalized)
    next_cp_norm_x = (next_checkpoint_x * 2.0 / WIDTH) - 1.0
    next_cp_norm_y = (next_checkpoint_y * 2.0 / HEIGHT) - 1.0
    rel_next_x = next_cp_norm_x - norm_x
    rel_next_y = next_cp_norm_y - norm_y
    obs.extend([rel_next_x, rel_next_y])

    # 7-8: Relative position to next-next checkpoint (normalized)
    next_next_cp_norm_x = (next_next_checkpoint_x * 2.0 / WIDTH) - 1.0
    next_next_cp_norm_y = (next_next_checkpoint_y * 2.0 / HEIGHT) - 1.0
    rel_next_next_x = next_next_cp_norm_x - norm_x
    rel_next_next_y = next_next_cp_norm_y - norm_y
    obs.extend([rel_next_next_x, rel_next_next_y])

    # 9-10: Pod's absolute angle as sin/cos
    pod_angle_rad = math.radians(angle)
    pod_angle_sin = math.sin(pod_angle_rad)
    pod_angle_cos = math.cos(pod_angle_rad)
    obs.extend([pod_angle_sin, pod_angle_cos])

    # 11-12: Angle to next checkpoint as sin/cos
    angle_to_next = math.atan2(next_checkpoint_y - y, next_checkpoint_x - x)
    angle_to_next_sin = math.sin(angle_to_next)
    angle_to_next_cos = math.cos(angle_to_next)
    obs.extend([angle_to_next_sin, angle_to_next_cos])

    # 13: Relative angle (how much to turn) normalized to [-1, 1]
    angle_to_next_deg = math.degrees(angle_to_next)
    relative_angle = angle_to_next_deg - angle
    # Normalize to [-180, 180] range
    while relative_angle > 180:
        relative_angle -= 360
    while relative_angle < -180:
        relative_angle += 360
    relative_angle_normalized = relative_angle / 180.0
    obs.append(relative_angle_normalized)

    # 14: Speed magnitude
    speed_magnitude = math.sqrt(vx * vx + vy * vy) / 800.0
    obs.append(speed_magnitude)

    # 15: Distance to next checkpoint
    distance_to_next_cp = math.sqrt((next_checkpoint_x - x) ** 2 + (next_checkpoint_y - y) ** 2)
    distance_normalized = distance_to_next_cp / 600.0
    obs.append(distance_normalized)

    # 16: Progress through race
    total_checkpoints = len(checkpoints) * 3  # Assuming 3 laps
    progress = next_checkpoint_id / total_checkpoints
    obs.append(progress)

    # 17: Shield cooldown (simplified - always 0 in CodinGame)
    shield_cooldown = 0.0
    obs.append(shield_cooldown)

    # 18: Boost availability
    boost_available = 0.0 if boost_used[pod_id] else 1.0
    obs.append(boost_available)

    # Add opponent information (30 dimensions total)
    # Build list of all other pods: teammate + 2 opponents
    all_other_pods = []
    
    # Add teammate data (if pod_id == 0, teammate is pod 1, vice versa)
    teammate_id = 1 - pod_id
    if teammate_id < len(pod_data_all):
        all_other_pods.append(pod_data_all[teammate_id])
    else:
        # Fallback: duplicate current pod data
        all_other_pods.append(pod_data)
    
    # Add opponent data (2 opponent pods)
    all_other_pods.extend(opponent_data)
    
    # Ensure we have exactly 3 opponents (teammate + 2 opponents)
    while len(all_other_pods) < 3:
        all_other_pods.append(all_other_pods[-1])  # Duplicate last if needed
    all_other_pods = all_other_pods[:3]  # Take only first 3

    # Process each opponent (10 dimensions each)
    for opp_data in all_other_pods:
        opp_x, opp_y, opp_vx, opp_vy, opp_angle, opp_next_cp_id = opp_data
        
        # 1-2: Relative position (normalized)
        opp_norm_x = (opp_x * 2.0 / WIDTH) - 1.0
        opp_norm_y = (opp_y * 2.0 / HEIGHT) - 1.0
        rel_opp_x = opp_norm_x - norm_x
        rel_opp_y = opp_norm_y - norm_y
        obs.extend([rel_opp_x, rel_opp_y])
        
        # 3-4: Relative velocity
        rel_opp_vx = (opp_vx - vx) / 1000.0
        rel_opp_vy = (opp_vy - vy) / 1000.0
        obs.extend([rel_opp_vx, rel_opp_vy])
        
        # 5: Distance to opponent (normalized)
        opp_distance = math.sqrt((opp_x - x)**2 + (opp_y - y)**2) / (WIDTH/2)
        obs.append(opp_distance)
        
        # 6: Opponent's absolute angle (normalized)
        opp_normalized_angle = (opp_angle % 360) / 180.0 - 1.0
        obs.append(opp_normalized_angle)
        
        # 7: Opponent's progress
        opp_progress = opp_next_cp_id / total_checkpoints
        obs.append(opp_progress)
        
        # 8: Opponent's next checkpoint (normalized)
        opp_next_cp_normalized = (opp_next_cp_id % len(checkpoints)) / len(checkpoints)
        obs.append(opp_next_cp_normalized)
        
        # 9: Opponent's shield cooldown (always 0 in CodinGame)
        obs.append(0.0)
        
        # 10: Opponent's boost availability (assume available)
        obs.append(1.0)

    # Verify we have exactly 48 dimensions
    # 18 (pod-specific) + 30 (3 opponents Ã— 10) = 48
    assert len(obs) == 48, f'Expected 48 dimensions, got {len(obs)}'
    return obs

